import React, { useEffect, useState} from "react";

import AccountComponent from "../Account Component/AccountComponent"

const AccountComponentContainer: React.FC<any> = (data) => {

    let [account, setAccount] = useState([])

    useEffect(() => {

        setAccount(data.data)

    }, [])


  return (
    <div>
        {account.map((account:any) => {

        return <AccountComponent {...account} key ={account.account_id}/>

    })

    }
    </div>
  )
}

export default AccountComponentContainer
